//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./SimpleStorage.sol";


    //Note: Reminder 
    // Function Decalaration in Solidity: 
    // function methName() visiblity{ } 
    // A Classic Get Function or a returning function 
    // function methName() visiblity view returns(type) { }

    // If Only a returning function then
    // function methName() visiblity returns(type) { }



contract StorageFactory{

    //Note: The versions of two interacting contracts are using should be compatible
    // Then on deploying the contract that interact the compiler, if the contracts are compatible 
    // then the compiler is switched to the most optimal compiler for interaction 

    // Solidity follows the OOPS Paradigm


    SimpleStorage[] public simpleStorageArray;

    function createSimpleStorage() public {
        SimpleStorage simpleStorage = new SimpleStorage();
        simpleStorageArray.push(simpleStorage);
    }


// To Store the Number in a particular Storage Contract 
    function sfStore(uint256 _simpleStorageIndex, uint256 _simpleStorageNumber) public{ 
        // There are two major components while interaction of two contracts
        // Address
        // Contract Interface => (ABI - (Application Binary Interface) faciltites this Interface)
        // ABI for a contract is the details, input, output, functions in the contract that can be interacted with 

        SimpleStorage st = simpleStorageArray[_simpleStorageIndex];
        st.store(_simpleStorageNumber);
    }

    // Getting the number stored in any of the storageContracts in the array
    function sfGet(uint256 _simpleStorageIndex) public view returns(uint256) {
        SimpleStorage st = simpleStorageArray[_simpleStorageIndex];
        return st.reterive();
    }
}

